import { Link } from "react-router-dom"

const MessageList = ({ msg, deletePhone }) => {

    const messageById = async (id) => {
       try {
            const res = await fetch(`${process.env.REACT_APP_SERVERURL}/message/${id}`)
            console.log(res)
       } catch (err) {
            console.log(err)
       }
    }

    return(
        <tr>
            <td>
                <Link onClick={() => messageById(msg.msg_id)} to={`/message/${msg.msg_id}`}>
                    <strong>{msg.msg_phone}</strong>
                </Link>
            </td>
            <td>
                <small>{msg.status[0].toUpperCase() + msg.status.slice(1)}</small>
            </td>
            <td>
                <Link  to={`/message/${msg.msg_id}/edit`}>
                    <button className="btn btn-warning">Editar</button>
                </Link>
            </td>
            <td>
                <button onClick={() => deletePhone(msg.msg_id)} className="btn btn-danger">Delete</button>
            </td>
        </tr>
    )
}

export default MessageList
